<html>


<!--
    Source Attribut (libellé):
    expertises id (Id)
    expertises batiment_id (Id du bâtiment)
    expertises date_expertise (Date d'expertise)
    expertises prestataire (Prestataire d'expertise)
    expertises nom_operateur (Nom de l'operateur)
    expertises cas_batiment (Cas du bâtiment)
    expertises classe (Classe d'intervention)
    expertises risque_passage (Risque sur les passants et le voisinage)
    expertises evacuation (Evacuation des ménages)
    expertises nbr_menage_evacuer (Nombre de ménages à évacuer)
    expertises mesures (Mesures conservatoires d'urgence)
    expertises estimation_travaux (Estimation des travaux (Dhs)))
    expertises is_valid (Accessibilité du bâtiments)
    expertises motif_refus (Motif d'inaccessibilité)
    expertises rapport_expertise (Rapport d'expertise)
    expertises signature_ingenieur (Signature de l'ingenieur)
    expertises signature_consultant (Signature du consultant)
    etat_construction description (Description)
    etat_construction observation (Observation)
    structures_materiaux structure_horizontale (Structure horizontale)
    structures_materiaux structure_verticale (Structure verticale)
    croquis miniature_1 (Miniature)
    croquis nom_du_fichier_1 (Nom Du Fichier)
    expertise_risque commentaire (Commentaire)
    expertise_risque justification (Justification)
    expertise_risque niveau (Niveau)
    risques nature (Nature)
    expertise_intervention partie_concernee (Partie Concernee)
    expertise_intervention type (Type)
    interventions mode_intervention (Mode d'intervention)
    batiments affaire_id (Id de l'affaire)
    batiments enqueteur (Enquêteur responsable)
    batiments nom_operateur_1 (Nom de l'operateur)
    batiments fiche_batisse (Fiche de la Bâtisse)
    mesures_proposees cas_batiment_1 (Cas du bâtiment)
    mesures_proposees classe_batiment (Classe du bâtiment)
    mesures_proposees justification_1 (Justification)
    expertise_risque description_1 (Description)
    expertise_risque description_2 (Description)
    structures_materiaux_constitutifs niveau_id (Niveau)
    pathologies_anomalies cause (Cause)
    pathologies_anomalies description_3 (Description)
    batiments typologie (Typologie)
    batiments nombre_niveau (Nombre de niveaux)
    batiments superficie_approximative (Superficie approximative)
    batiments occupation_batiment (Occupation du bâtiment)
    batiments statut_occupation (Statut d'occupation)
    interventions mode_intervention_1 (Mode d'intervention)
    bordereaux niveau_id_1 (Niveau)
    bordereaux quantite (Quantité)
    thematiques designation (Désignation)
    thematiques ouvrage_id (Ouvrage)
    thematiques prix_unitaire (Prix unitaire)
    thematiques unite (Unité)
    batiments occupation_batiment_1 (Occupation du bâtiment)
    elements_batiment nom (Nom)
    elements_batiment nom_1 (Nom)
    expertises nbr_niveaux (nbr_niveaux)
    expertises alert_pas_de_niveaux (alert_pas_de_niveaux)
    structures_materiaux_constitutifs materiaux_construction (Matériaux de construction)
    structures_materiaux_constitutifs observation_1 (Observation)
    particularites_structures particularite (Particularite)
    expertises section_vide (section_vide)
    facteurs_degradations miniature (Miniature)
    facteurs_degradations nom_du_fichier (Nom Du Fichier)
-->
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Rapport d'expertise</title>
    <style>
      @page {
  @bottom-center {
    content: 'Page ' counter(page) ' sur ' counter(pages);
  }
}
        .page-title {
            height: 100vh;
            position: relative;
        }

        .vertical-center {
             position: absolute;
              top: 500px;
              left: 180px;
             
            
        }

        table {
            border-collapse: collapse;
            width: 100%;
        }

        thead {
            background-color: gainsboro
        }

        th,
        td {
            border: 1px solid #000;
            padding: 8px;
        }
      	th{
      		text-align:center;
      	}
        img{
          width:100%;
          height:100%
        }
       .multiple-tables{
            width: 100%; 
            border:1px solid black;
        }
      
      #img_batisse{
      	height: 300px;
      	width: 200px;
      	border:3px solid black;
      }
    </style>
</head>

<body style="padding: 20px">
    <div style="border: 1px solid #000; overflow: hidden; height: 100px; position: relative;">
        <div
            style="float: left; padding: 5px; border-right: 1px solid black; width: 55%; box-sizing: border-box; height: 100%;">
            <img src="data:image/png;base64," alt="Image" style="width: 100%; height: 100%; height: auto;">
        </div>

        <h2
            style="overflow: hidden; margin: 0; box-sizing: border-box; width: 45%; padding: 5px; position: absolute; top: 50%; right: 0; transform: translateY(-50%); text-align: center;">
            « Prestataire »</h2>
    </div>

    <div style="text-align: center;margin: 0 auto; padding: 20px;">
        <h3 style="font-weight: bold">Marché N° {{{ value "numero_affaire" }}}</h3>
    </div>
    <div style="text-align: center;margin: 0 auto; padding: 20px;">
        <h4 style="font-weight: bold;text-decoration: underline">Objet du Marché</h4>
    </div>
    <div style="text-align: center;margin: 0 auto; padding: 20px;">
        <h3 style="font-weight: bold;text-decoration: underline">Rapport d’expertise technique</h3>
    </div>
    <div style="text-align: center;margin: 0 auto; padding: 20px" id="img_batisse">
      	{{#section "Photos du bâtiment "}}
        	{{#each features as |feature|}}
        		{{#@first}}     
        			{{{ prop feature "miniature_2"}}}
        		{{/@first}}
        	{{/each}}
        {{/section}}
    </div>
    <div style="text-align: center;margin: 40px auto; padding: 20px">
        <table>
            <thead>
                <tr>
                    <th>ID BMR</th>
                    <th>ADRESSE</th>
                    <th>DATE D’EXPERTISE</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>{{{ value "batiment_id" }}}</td>
                    <td>{{{ value "adresse_calcule" }}}</td>
                    <td>{{{ feature.date_expertise }}}</td>
                </tr>
            </tbody>
        </table>
    </div>
    <div style="text-align: center;margin: 0 auto;">
        <h3>Signature</h3>
      	<div style="text-align: center;margin: 0 auto; padding: 20px">
          <img src="data:image/png;base64,{{{ value "signature_ingenieur" }}}"  style="height: 30vh;width: 200px;">
        </div>
    </div>

   <div style="page-break-before:always">&nbsp;</div> 

    <div class="page-title">
        
            <h1 class="vertical-center">I. DIAGNOSTIC DU BATIMENT</h1>
        
    </div>


  <div style="page-break-before:always">&nbsp;</div> 

    <section style="margin:40px 0">
        <h2 style="text-decoration: underline">I. Contexte :</h2>
        <p>{{{ value "contexte" }}}</p>
    </section>

    <section style="margin:40px 0">
        <h2 style="text-decoration: underline">II. Information sur le Bâtiment :</h2>
        <table>
            <tr>
                <td style="width: 30%; background-color: gainsboro; font-weight: bold">Type du Bâtiment</td>
                <td>{{{ value "typologie" }}}</td>
            </tr>
            <tr>
                <td style="width: 30%; background-color: gainsboro; font-weight: bold">Nombre de niveaux</td>
                <td>{{{ value "nbr_niveaux_calculés" }}}</td>
            </tr>
            <tr>
                <td style="width: 30%; background-color: gainsboro; font-weight: bold">Superficie (m²)</td>
                <td>{{{ value "superficie_approximative" }}}</td>
            </tr>
            <tr>
                <td style="width: 30%; background-color: gainsboro; font-weight: bold">Occupation</td>
                <td>{{{ value "occupation_id" }}}</td>
            </tr>
            <tr>
                <td style="width: 30%; background-color: gainsboro; font-weight: bold">Usage du Bâtiment</td>
                <td>--</td>
            </tr>
        </table>
    </section>

    <section style="margin:40px 0">
      <h2>III. <span  style="text-decoration: underline">Structure et matériaux constitutifs :</span></h2>
       <table>
            <thead>
                <tr>
                    <th rowspan="2">Elément</th>
                    <th colspan="{{{  prop feature "nbr_niveaux" or 1}}}">Matériaux de construction </th>
                    <th rowspan="2">Observation</th>
                </tr>
                <tr>
                    {{#section "Niveaux"}}
                    {{#each features as |feature|}}
                        <th>{{{ prop feature "label"}}}</th>
                    {{/each}}
                    {{/section}}
                </tr>
            </thead>
            <tbody>
              {{#loop "elements_batiment"}} 
              <tr>
                    <td style="font-weight: bold">{{{ prop "nom" }}}</td>
                		{{#section "Niveaux"}}
                      {{#each features as |feature|}}
                
                        <td>
                          <div>
                            {{#section "Structure et matériaux constitutifs"}}
                              {{#each ././features  as |structure|}}
                              <ul>
                                 {{#eq structure.niveau_id  ../feature.label  }}

                                  {{#eq structure.nom_1  ../../../nom  }}
                                    {{#structure.materiaux_construction  }}
                                      <li>
                                        {{{ structure.materiaux_construction }}}       
                                      </li>
                                  {{/structure.materiaux_construction  }}
                                  {{/eq}}
                                 {{/eq}}
                              </ul>
                              {{/each}}
                            {{/section}}
                          </div>
                        </td>
                      {{/each}}
                
                      {{^features}}
                        <td></td>
                      {{/features}}
                		{{/section}}
                
                    <td>
                      {{#section "Structure et matériaux constitutifs"}}
                            {{#each ././features f as |structure|}}
                            <ul>
                            {{#eq structure.nom_1  ../../../nom  }}
                              {{#structure.observation_1}}
                               	<li>
                                  {{{ structure.niveau_id }}}:{{{structure.observation_1 }}}         
                              	</li>
                              {{/structure.observation_1}}
                            {{/eq}}
                              
                            </ul>
                            {{/each}}
                         	{{/section}}
                		</td>
                </tr>
              {{/loop}}
            </tbody>
        </table>
    </section>

    <section>
        <h2 style="text-decoration: underline">IV. Particularités à signaler sur la structure du Bâtiment :</h2>
        <table>
          
            
              {{#loop "particularites_structures"}}
          				
              		{{#if @even }}
          				<tr>
                 	{{/if}}
         			      <td>
                    	{{#section "Particularités à signaler sur la structure du bâtiment"}}
                          {{#each features as |feature|}}
                           {{#eq feature.particularite ../../particularite}}
                              x
                           {{/eq}}
                          {{/each}}
											{{/section}}
                    </td>
                		<td style="font-weight: bolder">{{{ prop "particularite" }}}</td>
                   {{#if @odd }}
          				</tr>
                 	{{/if}}
         
              {{/loop}}
        </table>
    </section>

    <div style="page-break-before:always">&nbsp;</div> 
  
    <section>
        <h2 style="text-decoration: underline">V. Pathologies et Anomalies :</h2>
        <table>
            <thead>
                <tr>
                    <th>Elément du bâtiment</th>
                    <th>Description des pathologies par niveau</th>
                    <th>Causes potentielles</th>
                </tr>
            </thead>
            <tbody>
              {{#loop "elements_batiment"}} 
               <tr>
                    <td style="font-weight: bold">{{{ prop "nom" }}}</td>
                 		<td>
                      {{#section "Pathologies et Anomalies "}}
                      {{#each features as |feature|}}
                        {{#eq  feature.nom ../../nom}}
                               {{{  prop feature "description_3" }}}
                        {{/eq}}     
                      {{/each}}
                  	{{/section}}
                 		</td>
                 		<td>
                      {{#section "Pathologies et Anomalies "}}
                      {{#each features as |feature|}}
                        {{#eq  feature.nom ../../nom}}
                             {{{  prop feature "cause" }}}
                        {{/eq}}     
                      {{/each}}
                  	{{/section}}
                 		</td>
                </tr>
              {{/loop}}
            </tbody>

        </table>
    </section>
  
  <div style="page-break-before:always">&nbsp;</div> 
  
     <section>
        <h2 style="text-align: center;text-decoration: underline;">Illustrations photographiques commentées des Pathologies
        </h2>
    
        <ul>
          {{#section "Niveaux"}}
          {{#each features as |feature|}}
            <li><h4 style="text-decoration: underline;"> {{{ prop feature "label"}}} </h4></li>
          	
          	{{#section "Facteurs de dégradations"}}
              {{#each ././features as |photo|}}
          		{{#eq ../label photo.niveau_id_3}}    	
           	 <div style="width:100%">
                <div style="width: 50%;box-sizing: border-box;float: left;">
                    <div style="width: 100%; height: 300px; border:1px solid black">
                      <div style="height: 100%;width:100%;">{{{ prop photo "miniature"}}}</div>
                    </div>
                    <div style="width: 100%; border:1px solid black;">
                      <p style="padding:3px;box-sizing:border-box;"> <strong>{{{ prop photo "facteur_calcule"}}} </strong> {{{ prop photo "detail"}}}</p> 
                    </div>
                </div>    
           </div>
          		{{/eq}}
              {{/each}}

              {{/section}}
           <div style="page-break-before:always">&nbsp;</div> 
          {{/each}}
          {{/section}}
        </ul>
    </section>
  
 
  
  <section>
    <h2>VI. <span style="text-decoration: underline">Jugement des risques:</span></h2>
        <table>
            <thead>
                <tr>
                    <th colspan="2">Nature du risque</th>
                    <th >Description du risque</th>
                </tr>
            </thead>
            <tbody>
              {{#loop "risques"}} 
              	<tr>
                    <td style="text-align:center">
                      {{#section "Jugement de risques "}}
                        {{#each features as |feature|}}
                          {{#eq feature.nature ../../nature}}
                          	<strong>x</strong>
                          {{/eq}}
                        {{/each}}
                      {{/section}}
                  	</td>
                    <td>{{{ prop "nature"}}}</td>
                    <td>
                      {{#section "Jugement de risques "}}
                        {{#each features as |feature|}}
                          {{#eq feature.nature ../../nature}}
                          	{{{ feature.description_2 }}}
                          {{/eq}}
                        {{/each}}
                      {{/section}}
                  	</td>
                </tr>
              {{/loop}}
                
            </tbody>
        </table>
    </section>
  
   <section style="width:100%">
        <h2>VI. <span style="text-decoration: underline">Mesures proposées:</span></h2>
        <div style="width: 100%;">
            <table style="width: 33% !important;display: inline-table;">
                <thead>
                    <tr>
                        <th colspan="2">Actions d’urgence</th>
                    </tr>
                </thead>
                <tbody>
                  	{{#loop 'interventions'}}
                    <tr>
                        <td style="text-align:center;width:15%">
                          {{#section "Interventions"}}
                            {{#each features as |feature|}}
                            {{#eq feature.mode_intervention_1 ../../mode_intervention}}
                          <strong>x</strong>
                            {{/eq}}
                            {{/each}}
                          {{/section}}
                      	</td>
                        <td>{{{prop 'mode_intervention'}}}</td>
                    </tr>
                  {{/loop}}
                </tbody>
            </table>
            <table style="width: 33% !important;display: inline-table;">
                <thead>
                    <tr>
                        <th colspan="2">Classe du Bâtiment</th>
                    </tr>
                </thead>
                <tbody>
                    	{{#loop 'classes_interventions'}}
                       <tr>
                        <td style="text-align:center;width:15%">                       
                          {{#section "Mesures/Interventions proposées"}}
                            {{#each features as |feature|}}
                              {{#eq feature.classe_intervention_id ../../id}}
                              	<strong>x</strong>
                              {{/eq}}
                            {{/each}}
                          {{/section}}
                      	</td>
                        <td>{{{prop 'classe'}}}</td>
                    </tr>
                  {{/loop}}
                </tbody>
            </table>
            <table style="width: 33% !important;display: inline-table;">
                <thead>
                    <tr>
     
                        <th colspan="2">Cas du Bâtiment</th>
                    </tr>
                </thead>
                <tbody>
                  	<tr>
                        <td style="text-align:center;width:15%">  
                      		 {{#section "Mesures/Interventions proposées"}}
                            {{#each features as |feature|}}
                              {{#eq feature.cas_batiment_1 'Cas ordinaire'}}
                              	<strong>x</strong>
                              {{/eq}}
                            {{/each}}
                          {{/section}}
                      	</td>
                        <td>cas ordinaire</td>
                    </tr>
                    <tr>
                        <td style="text-align:center">
                          {{#section "Mesures/Interventions proposées"}}
                            {{#each features as |feature|}}
                              {{#eq feature.cas_batiment_1 'Cas urgent'}}
                              	<strong>x</strong>
                              {{/eq}}
                            {{/each}}
                          {{/section}}
                      	</td>
                        <td>cas urgent</td>
                    </tr>
                </tbody>
            </table>
        </div>
     		<div style="width:100%;padding:5px;margin:5px 0;border:1px solid black;">
          	<h3 style="margin:0;padding:0;">Justification:</h3>
       	    <p>
              	{{#section "Mesures/Interventions proposées"}}
                  {{#each features as |feature|}}
                    {{{ prop feature "justification_1"}}}
                  {{/each}}
                {{/section}}
         	</p>
        </div>
    </section>
  
   <div style="page-break-before:always">&nbsp;</div> 

    <div class="page-title">      
        <h1 class="vertical-center">II. TRAITEMENT DU BATIMENT</h1>      
    </div>

  <div style="page-break-before:always">&nbsp;</div> 
  
  
   <section>
        <h2>I. <span style="text-decoration: underline">Travaux à réaliser :</span></h2>
       <table>
              <thead>
                  <tr>
                      <th style="padding-top:10px;padding-bottom:10px">Emplacement</th>
                      <th  style="padding-top:10px;padding-bottom:10px">Travaux à réaliser</th>
                  </tr>
              </thead>
              <tbody>
                {{#section "Niveaux"}}

                {{#each features as |niveau|}}
                  {{#gt niveau.nbr_thematiques "0"}}
                  <tr>
                      <td rowspan="{{{ prop niveau "nbr_thematiques_plus_1"}}}"><strong>{{{ prop niveau "label"}}}</strong></td>  
                  </tr>
                       {{#section "Ouvrages"}}
                        {{#each ././features as |thematique|}}
                          {{#eq thematique.niveau_id_1 niveau.label}}
                          <tr>
                            <td style="padding:20px 5px"><strong>{{{ prop thematique "designation"}}}</strong></td>
                          </tr>
                          {{/eq}}
                        {{/each}}
                        {{/section}}
                  {{/gt}}
                {{/each}}
                {{/section}}
              </tbody>
          </table>
    </section>
  
   <div style="page-break-before:always">&nbsp;</div> 
  
     <section>
        <h2>II. <span style="text-decoration: underline">Estimation des travaux par niveau :
        </span></h2>
       {{#section "Niveaux"}}
         {{#each features as |niveau|}}
         <table style="margin-bottom:50px">
           <thead style="background-color: gray">
             <tr>
               <td colspan="6" style="text-align: center;font-weight: bold;font-size: 18px">{{{niveau.label}}}</td>
             </tr>
           </thead>
           <thead>
             <tr>
               <th style="width:8%">N°</th>
               <th style="width:40%">Désignation</th>
               <th style="width:7%">U</th>
               <th style="width:10%">Qte</th>
               <th style="width:18%">Prix Unitaire</th>
               <th style="width:15%">Montant HT</th>
             </tr>
           </thead>
           <tbody>
             {{#gt niveau.nbr_thematiques "0"}}
                  {{#section "Ouvrages"}}
                     {{#each ././features as |thematique|}}
                     {{#eq thematique.niveau_id_1 niveau.label}}
             						 <tr>
                           <td style="font-weight:bold;text-align:center">{{{ thematique.numero_1 }}}</td>
                           <td>{{{ thematique.designation }}}</td>
                           <td style="text-align:center">{{{ thematique.unite }}}</td>
                           <td style="text-align:center">{{{ thematique.prix_unitaire }}}</td>
                           <td style="text-align:center">{{{ thematique.quantite }}}</td>
                           <td style="text-align:center">{{{ thematique.total }}}</td>
                         </tr>
                     {{/eq}}
                     {{/each}}
             			{{/section}}
               
             			<tr>
                    	<td colspan="2" rowspan="4"></td>             	
             			</tr>     
             			<tr>
                    <td colspan="3"><strong>Total HT</strong></td>
                    <td style="text-align:center">
                      {{#section "Niveaux/Bordereaux "}}
                      	{{#each ././features as |item|}}
                      	{{#eq item.label_1 niveau.label }}
                      		{{{ prop item "total_1"}}}
                      	{{/eq}}
                      	{{/each}}
                      {{/section}}
                    </td>
             			</tr>
             			<tr>
                    <td colspan="3"><strong>TVA</strong></td>
                    <td style="text-align:center">
                      {{#section "Niveaux/Bordereaux "}}
                      	{{#each ././features as |item|}}
                      	{{#eq item.label_1 niveau.label }}
                      		{{{ prop item "tva"}}}
                      	{{/eq}}
                      	{{/each}}
                      {{/section}}
                    </td>
             			</tr>
             			<tr>
                    <td colspan="3"><strong>Total TTC</strong></td>
                    <td style="text-align:center">
                      {{#section "Niveaux/Bordereaux "}}
                      	{{#each ././features as |item|}}
                      	{{#eq item.label_1 niveau.label }}
                      		{{{ prop item "total_tcc"}}}
                      	{{/eq}}
                      	{{/each}}
                      {{/section}}
                    </td>
             			</tr>
							{{/gt}}
              {{#eq niveau.nbr_thematiques "0"}}
               <tr>
                 <td colspan="5">Pas de thématiques pour ce niveau</td>
               </tr>
							{{/eq}}
           </tbody>
         </table>
         {{/each}}
			{{/section}}
      
    </section>
     <div style="page-break-before:always">&nbsp;</div> 

    <div class="page-title">
    	<h1 class="vertical-center" style="left:300px">III. Annexes</h1>
    </div>

  <div style="page-break-before:always">&nbsp;</div> 

</body>
</html>
